import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';  // Updated import

const CarDetail = () => {
  const [car, setCar] = useState(null);
  const [isEditing, setIsEditing] = useState(false);
  const [carData, setCarData] = useState({
    title: '',
    description: '',
    tags: '',
    images: []
  });
  const { carId } = useParams();
  const navigate = useNavigate();  // Replaced useHistory with useNavigate

  useEffect(() => {
    const fetchCar = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/cars/${carId}`, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`
          }
        });
        setCar(response.data);
        setCarData({
          title: response.data.title,
          description: response.data.description,
          tags: response.data.tags,
          images: response.data.images || []
        });
      } catch (error) {
        console.error('Error fetching car:', error);
      }
    };

    fetchCar();
  }, [carId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCarData((prevData) => ({
      ...prevData,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.put(
        `http://localhost:5000/api/cars/${carId}`,
        carData,
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`
          }
        }
      );
      setIsEditing(false);
      alert('Car updated successfully');
    } catch (error) {
      console.error('Error updating car:', error);
      alert('Error updating car');
    }
  };

  const handleDelete = async () => {
    try {
      await axios.delete(`http://localhost:5000/api/cars/${carId}`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`
        }
      });
      navigate('/cars');  // Replaced history.push with navigate
    } catch (error) {
      console.error('Error deleting car:', error);
      alert('Error deleting car');
    }
  };

  if (!car) {
    return <div>Loading...</div>;
  }

  return (
    <div className="car-detail">
      <h2>{car.title}</h2>
      <p>{car.description}</p>
      <p><strong>Tags:</strong> {car.tags}</p>
      <div>
        <strong>Images:</strong>
        <div>
          {car.images && car.images.map((img, index) => (
            <img key={index} src={img} alt={`Car ${car.title} image ${index + 1}`} />
          ))}
        </div>
      </div>
      {isEditing ? (
        <div>
          <h3>Edit Car</h3>
          <form onSubmit={handleSubmit}>
            <div>
              <label>Title</label>
              <input
                type="text"
                name="title"
                value={carData.title}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label>Description</label>
              <textarea
                name="description"
                value={carData.description}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label>Tags</label>
              <input
                type="text"
                name="tags"
                value={carData.tags}
                onChange={handleChange}
                required
              />
            </div>
            <button type="submit">Update Car</button>
          </form>
        </div>
      ) : (
        <div>
          <button onClick={() => setIsEditing(true)}>Edit Car</button>
          <button onClick={handleDelete}>Delete Car</button>
        </div>
      )}
    </div>
  );
};

export default CarDetail;
